-- Close batches missed while Kofax servers were unavailable (March 16 to 23, 2015) including those created during the outage.

/*  

-- Get complete dates createed via NYHIX-14394

select 
  'update CORP_ETL_MFB_BATCH set BATCH_COMPLETE_DT = to_date(''' || COMPLETE_DT || 
  ''',''YYYY-MM-DD HH24:MI:SS''),STG_LAST_UPDATE_DATE = sysdate,CURRENT_BATCH_MODULE_ID = ''N/A''' ||
  ' where BATCH_NAME = ''' || BATCH_NAME || ''' and BATCH_COMPLETE_DT is null and INSTANCE_STATUS = ''Active'';'
from TEST_RBK_CEMBS
order by COMPLETE_DT asc;
*/

